import React from "react";
import Container from "../component/Container";

function Dashboard() {
  return (
    <div className="w-screen h-screen grid grid-cols-9 grid-rows-[8]">
      <Container className={"col-span-9 h-full"}></Container>
      <Container className={"col-span-7 row-span-5 h-[595px] overflow-auto"}>
        <div className="container grid grid-cols-3 gap-4">
          {[1, 2, 3, 4, 5, 6, 7, 8, 9, 0].map((items, index) => {
            return (
              <Container className={"grid grid-rows-6 p-0 py-0"}>
                <div className="row-span-6 p-0">
                  <Container></Container>
                </div>
                <div className="px-5 py-2">
                  <p> Title {items}</p>
                </div>
                <div className="px-5 py-2">
                  <p> Title {items}</p>
                </div>
              </Container>
            );
          })}
        </div>
      </Container>
      <Container className={"col-span-2 row-span-5 h-full"}></Container>
    </div>
  );
}

export default Dashboard;
